import { Carousel, CarouselItem } from "./components/carousel";
import "./tailwind.output.css";

const items = new Array(10).fill(0);
export default function App() {
  return (
    <div className="flex flex-col gap-4 ">
      <h1>Composable Carousel:</h1>
      <Carousel.Root className="border border-black">
        {items.map((_, index) => (
          <CarouselItem
            key={index}
            className="border border-red py-10 w-5/6 shrink-0"
          >
            {index}
          </CarouselItem>
        ))}
      </Carousel.Root>
    </div>
  );
}
